// PaceHeartRateHistogram.js
import React from 'react';
import { Bar } from 'react-chartjs-2';

const PaceHeartRateHistogram = ({ data }) => {
  const paceGroups = Object.keys(data);

  const chartData = {
    labels: paceGroups,
    datasets: paceGroups.map((pace) => ({
      label: pace,
      data: data[pace].map((heartRate) => ({ x: heartRate, y: pace })),
      backgroundColor: 'rgba(75, 192, 192, 0.2)', // Adjust the color as needed
      borderColor: 'rgba(75, 192, 192, 1)', // Adjust the color as needed
      borderWidth: 1,
    })),
  };

  const options = {
    scales: {
      x: {
        position: 'bottom',
        title: {
          display: true,
          text: 'Heart Rate',
        },
      },
      y: {
        title: {
          display: true,
          text: 'Pace',
        },
      },
    },
  };

  return <Bar data={chartData} options={options} />;
};

export default PaceHeartRateHistogram;
